import React from 'react';
import {
  Card, Button, CardImg, CardTitle, CardText, CardDeck,
  CardSubtitle, CardBody
} from 'reactstrap';
import { Container, Row, Col } from 'reactstrap';

const Example = (props) => {
  return (
    <Container>
      <Row>
        <Col xs={3}>
            1
        </Col>
        <Col xs={3}>
            2
        </Col>
        <Col xs={3}>
            3
        </Col>
      </Row>
    </Container>
  );
};

export default Example;
